import React, { useState } from "react";
import CalWrapper from "../CalWrapper/CalWrapper";

const Cal = () => {

  const [inputVal1, setInputVal1] = useState(0);
  const allBtArr = [
    {
      value: 0,
      btFun: () => {
        setInputVal1((prev) => {
          const newValue = prev.toString() + 0;
          console.log("prev: ",prev);
          console.log("newval: ",newValue);
          return parseInt(prev.toString() + 0)
        });
      },
    },
    {
      value: 1,
      btFun: () => {
        setInputVal1((prev) => {
          const newValue = prev.toString() + 1;
          console.log("prev: ",prev);
          console.log("newval: ",newValue);
          return parseInt(prev.toString() + 1)
        });
      },
    },
    {
      value: 2,
      btFun: () => {
        setInputVal1((prev) => {
          const newValue = prev.toString() + 2;
          console.log("prev: ",prev);
          console.log("newval: ",newValue);
          return parseInt(prev.toString() + 2)
        });
      },
    },
    {
      value: 3,
      btFun: () => {
        setInputVal1((prev) => {
          const newValue = prev.toString() + 3;
          console.log("prev: ",prev);
          console.log("newval: ",newValue);
          return parseInt(prev.toString() + 3)
        });
      },
    },
    {
      value: 4,
      btFun: () => {
        setInputVal1((prev) => {
          const newValue = prev.toString() + 3;
          console.log("prev: ",prev);
          console.log("newval: ",newValue);
          return parseInt(prev.toString() + 4)
        });
      },
    },
  ];

  return (
    <div>
      <p>This is Cal {inputVal1}</p>
      <CalWrapper allBtArr={allBtArr} />
    </div>
  );
};

export default Cal;
